import React from 'react';
import './Slideshow.css';

function Slideshow() {
  return (
    <div class="slideshow">
        <Image name="DSC00533.jpg"></Image>
    </div>
  )
}

function Image(props) {
    return (
        <img class="responsive" src={props.name}></img>
    );
}


export default Slideshow;
